import './Landing.css';
import React from 'react';
import SimpleAppBar from './components/SimpleAppBar';
import {background, secondary} from './components/colors';

function Landing() {
    return (
      <React.Fragment>
        <SimpleAppBar />
        <div className="Landing" sx={{background: background}}></div>
      </React.Fragment>
    );
  }
  
  export default Landing;
